DELIMITER ;;
CREATE DEFINER=`fsAdmin`@`%` FUNCTION `calculate_price`(delivery_type INT, delivery_coverage INT, consignment_type FLOAT) RETURNS float
BEGIN
DECLARE price FLOAT;
SELECT 
((((pow(consignment_type, 2) * 5) 
 * (delivery_type * 5) 
 * ((pow(delivery_coverage, 2)) * 10)) 
 / 40) * 10)
INTO price;
RETURN price;
END ;;
