CREATE DEFINER=`fsAdmin`@`%` PROCEDURE `Clear_data`()
BEGIN

DECLARE v_shipment_id INT;
DECLARE v_finished INT;
DECLARE v_item_id INT;

DEClARE id_cursor CURSOR FOR 
SELECT shipment_id FROM shipment WHERE  (`shipment`.`date` <= (CURDATE() + INTERVAL -(2) MONTH));

DECLARE CONTINUE HANDLER 
FOR NOT FOUND SET v_finished = 1;

OPEN id_cursor;

id_cursor: LOOP

FETCH id_cursor into v_shipment_id;

IF v_finished = 1 THEN 
LEAVE id_cursor;
END IF;

SELECT item_id FROM shipment WHERE shipment_id = v_shipment_id INTO v_item_id;
DELETE FROM shipment WHERE shipment_id = v_shipment_id;
DELETE FROM item WHERE item_id = v_item_id;

END LOOP id_cursor;

END ;;
